import React from 'react'
import kill from '../assets/kill.png';

function Skill() {
  return (
    <div name='skill' className='bg-[#0A192F]'>
{/* Container */}
        <div >

            <p>Experience</p>
            <p> These are some of the skills I know</p>

        </div>

        <div>
            <div>
                <img className='w-20 mx-auto' src={kill} alt="Skill" />
                <p>SHOPIFY</p>
            </div>
        </div>



    </div>
  )
}

export default Skill
